import React from 'react';


function Contact() {
return (
	<div className="container-fluid">
	
	
		<h1>
		Contact Me
		</h1>
		
		<p>
		<ul>
			<li>
				Email: mhorner126@gmail.com or horner.156@osu.edu
			</li>
			<li>
				Phone: 614-940-2902
			</li>
		</ul>
		</p>
		
		
		
		
	</div>
);
}

export default Contact;
